import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Modal, Button } from "react-bootstrap";
import { useState } from "react";
import { Reminder } from "./remind";

const Popup = () => {
  const [naita, setNaita] = useState(false);

  const handleClose = () => setNaita(false);
  const handleShow = () => setNaita(true);

  return (
    <div>
      <Button onClick={handleShow}>Lisa eesmark</Button>

      <Modal show={naita} onHide={handleClose}>
        <Modal.Header closeButton>
          <Modal.Title>Modal heading</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <div></div>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleClose}>
            Close
          </Button>
          <Button variant="primary" onClick={handleClose}>
            Save Changes
          </Button>
        </Modal.Footer>
      </Modal>
    </div>
  );
};
export { Popup };
